      <!-- Button next page -->
      <router-link to="/lesson1_8">
        <button type="button" class="btn-continue"></button>
      </router-link>

      <!-- Button previous page -->
      <router-link to="/lesson1_6">
        <button type="button" class="btn-return"></button>
      </router-link>

      <!-- Establishing the Funifelt logo  -->
      <div>
        <input
          type="image"
          id="btn-logo"
          alt="logo"
          src="data:image/png;base64,
        
        
        
        
        
        
        
        
        
        
        "
        />
      </div>
    </div>

    <center>
      <h2 style="color: black">RULETA DE LAS PLANTAS</h2>
      <br />
      <div id="canvasExterior">
        <canvas id="capaInterior">
          <br /><br />
          <div style="background: black; padding: 15px"></div>
        </canvas>
        <canvas id="capaSuperior" @click="spin();" @mousedown="wheelMouseDown(event);" @mousemove="wheelMouseMove(event);"
        @mouseup="wheelMouseUp"> </canvas>
      </div>

      <!-- Button to spin the roulette  -->
      <div>
        <input
          type="image"
          id="btn-roulette"
          alt="spin-roulette"
          src="data:image/png;base64,
          
          
          
          
          
          
          
          
          
          
          
          
          
          "
          v-model="event"
          @click="spin()"
          @mousedown="wheelMouseDown(event)"
          @mousemove="wheelMouseMove(event)"
          @mouseup="
            wheelMouseUp(event);
            spin();
          "
          @mouseout="wheelMouseUp(event)"
        />
      </div>

      <audio id="wheelAudio" preload="auto">
        <source
          url="../../assets/sounds/sound_soft_short.ogg"
          type="audio/ogg"
        />
        <source
          url="../../assets/sounds/sound_soft_short.mp3"
          type="audio/mpeg"
        />
      </audio>
      <audio id="wheelAudio2">
        <source
          url="../../assets/sounds/sound_soft_short.ogg"
          type="audio/ogg"
        />
        <source
          url="../../assets/sounds/sound_soft_short.mp3"
          type="audio/mpeg"
        />
      </audio>
      <audio id="wheelAudio3">
        <source
          url="../../assets/sounds/sound_soft_short.ogg"
          type="audio/ogg"
        />
        <source
          url="../../assets/sounds/sound_soft_short.mp3"
          type="audio/mpeg"
        />
      </audio>
      <audio id="wheelAudioFinal" preload="auto">
        <source url="../../assets/sounds/sound-end.ogg" type="audio/ogg" />
        <source url="../../assets/sounds/sound-end.mp3" type="audio/mpeg" />
      </audio>
    </center>
  </body>
</template>

<script >
export default {
  name: "Lesson1_g3_app",
  data() {
    return {
      // setting the variable to the canvas
      isMouseDown: false,
      lastX: 0,
      lastY: 0,
      midX: 249,
      midY: 249,
      startAngle: 0,
      isMuted: false,
      choiceTextSize: [],
      spinTimeout: null,
      spinAngleStart: 10,
      spinTime: 0,
      spinTimeTotal: 0,
      spinAngleEnd: 0,
      ctx: 0,
      ctxTop: 0,
      audio1ended: true,
      audio2ended: true,
      audio3ended: true,
      x: 0,
      y: 0,
      spinAngle : 0,
      touch: null,
      wedgeAngle : 360 / 12,
      angleSinceBeep : 0,
      timeSinceBeep : 0,
      isFirstSpinCycle : false,
      isOddNumberOfChoices : false,
      lastChoiceBeepedFor : -1,
      spinAngleRad: 0,
      ts: 0,
      tc: 0,
      degrees: 0,
      arcd: 0,
      index: 0,
      text: "",
      choice: null,
      degreesMod: 0,
      colors: ["#1a428a", "#6fcfeb", "#1a428a", "#6fcfeb" ],
      questions: ["Pregunta 1", "Pregunta 2", "Pregunta 3", "Pregunta 4"],
      numcolors: 0,
      intTextBox: 4,
      choiceCount: 0,
      weights: [],
      numoptions: 0,
      numOptionsWeighted: 0,
      arc: 0,
      isMobile: false,
      wheelSize: 500,
      canvasWidth: 500,
      wheelImage: new Image(),
      wheelRadius: 0,
      outsideRadius: 0,
      textRadius: 0,
      insideRadius: 0,
      weightedIndex: 0,
      minDimension: 0,
      weightedArc: 0,
      weight: 1,
      angle: 0,
      endAngle: 0,
      minTimeToSpin: 5,
      timeRange: 4,
      minAngleToStartRotating: 20,
      angleRange: 30,
      textHWidth: 0,
      imageObj: new Image(),
      angHalfArc: 0,
      maxHeight: 0,
      maxWidth: 0,
      audio: null,
      audio2: null,
      audio3: null,
      canvasTop: null,
      canvas: null,
      currChoiceIndex: null,
      canvOuter: null,
      audioFinal: null
    }
  },
  mounted() {
      // Setting the variables from html template
      this.maxHeight= window.screen.availHeight,
      this.maxWidth= window.screen.availWidth,
      this.audio = document.getElementById("wheelAudio"),
      this.audio2 = document.getElementById("wheelAudio2"),
      this.audio3 = document.getElementById("wheelAudio3"),
      this.canvasTop = document.getElementById("capaSuperior"),
      this.canvas = document.getElementById("capaInterior"),
      //this.currChoiceIndex = getCurrentChoiceWithWeights().index,
      this.canvOuter = document.getElementById('canvasExterior'),
      this.audioFinal = document.getElementById("wheelAudioFinal"),

      this.wheelRadius = this.wheelSize * 0.5,
      this.outsideRadius = this.wheelRadius,
      this.textRadius = this.wheelRadius * 0.9,
      this.insideRadius = this.wheelRadius * 0.1
      this.weightedArc = this.arc
  },
  methods: {
    wheelMouseMove(e) {
        if (this.isMouseDown == true) {
            this.x = e.clientX + document.documentElement.scrollLeft + document.body.scrollLeft;
            this.y = e.clientY + document.documentElement.scrollTop + document.body.scrollTop;
            this.spinAngle = 0;
            if (this.x > this.midX) {
                if (this.y > this.midY) {
                    this.spinAngle = ((this.lastX - this.x) - (this.lastY - this.y)) * 0.01;
                } else {
                    this.spinAngle = (0 - (this.lastX - this.x) - (this.lastY - this.y)) * 0.01;
                }
            } else {
                if (this.y > this.midY) {
                    this.spinAngle = ((this.lastX - this.x) + (this.lastY - this.y)) * 0.01;
                } else {
                    this.spinAngle = (0 - (this.lastX - this.x) + (this.lastY - this.y)) * 0.01;
                }
            }
            this.startAngle += (this.spinAngle * 10 * Math.PI / 180);
            this.lastX = this.x;
            this.lastY = this.y;
            this.drawRouletteWheelImage(this.spinAngle * 10);
        }
    },

    wheelMouseMove2(x, y) {
        if (this.isMouseDown == true) {
            this.spinAngle = 0;
            if (x > this.midX) {
                if (y > this.midY) {
                    this.spinAngle = ((this.lastX - x) - (this.lastY - y)) * 0.01;
                } else {
                    this.spinAngle = (0 - (this.lastX - x) - (this.lastY - y)) * 0.01;
                }
            } else {
                if (y > this.midY) {
                    this.spinAngle = ((this.lastX - x) + (this.lastY - y)) * 0.01;
                } else {
                    this.spinAngle = (0 - (this.lastX - x) + (this.lastY - y)) * 0.01;
                }
            }

            this.startAngle += (this.spinAngle * 10 * Math.PI / 180);

            this.lastX = x;
            this.lastY = y;
            this.drawRouletteWheelImage(this.spinAngle * 10);
        }
    },

    wheelMouseUp(e) {
        this.isMouseDown = false;
    },

    playSound() {
        if (this.isMuted == false) {
            this.audio = document.getElementById("wheelAudio");
            if (this.audio1ended) {
                this.audio1ended = false;
                this.audio.play();
                this.audio.addEventListener('ended', function () {
                    this.audio1ended = true;
                }, false);
            } else if (this.audio2ended) {
                this.audio2ended = false;
                this.audio2 = document.getElementById("wheelAudio2");
                this.audio2.play();
                this.audio2.addEventListener('ended', function () {
                    this.audio2ended = true;
                }, false);
            } else if (this.audio3ended) {
                this.audio3ended = false;
                this.audio3 = document.getElementById("wheelAudio3");
                this.audio3.play();
                this.audio3.addEventListener('ended', function () {
                    this.audio3ended = true;
                }, false);
            }
        }
    },

    addTouchEventListeners() {
        this.canvasTop = document.getElementById("capaSuperior");
        this.canvasTop.addEventListener('touchmove', function (e) {
            e.preventDefault();
            this.touch = e.touches[0];
            wheelMouseMove2(this.touch.pageX, this.touch.pageY);
        }, false);

        this.canvasTop.addEventListener('touchstart', function (e) {
            e.preventDefault();
            this.touch = e.touches[0];
            wheelMouseDown(this.touch);
        }, false);

        this.canvasTop.addEventListener('touchend', function (e) {
            e.preventDefault();
            this.touch = e.touches[0];
            wheelMouseUp(this.touch);
            spin();
        }, false);
    },

    clearTopCanvas() {
        this.canvasTop = document.getElementById("capaSuperior");
        if (this.canvasTop.getContext) {
            this.ctxTop = this.canvasTop.getContext("2d");
            this.ctxTop.clearRect(0, 0, this.canvasWidth, this.canvasWidth);
        }
    },

    draw() {
        setChoiceFontSizes();
        drawRouletteWheel();
        setWheelImageSource();
    },

    drawArrow() {
        this.canvasTop = document.getElementById("capaSuperior");
        if (this.canvasTop.getContext) {

            this.ctxTop = this.canvasTop.getContext("2d");

            //Arrow
            this.ctxTop.fillStyle = "#fa0101";
            this.ctxTop.beginPath();
            // Left Side
            this.ctxTop.moveTo(0, this.wheelRadius + 30);
            this.ctxTop.lineTo(0, this.wheelRadius - 30);
            this.ctxTop.lineTo(53, this.wheelRadius);
            vctxTop.lineTo(0, this.wheelRadius + 30);

            this.ctxTop.fill();
            //ctxTop.translate( canvas.width/2 , canvas.height/2 );
        }
    },

    setWheelImageSource() {
        this.canvas = document.getElementById("wheelcanvas");
        if (this.canvas.getContext) {
            this.ctx = this.canvas.getContext("2d");
            if (this.wheelImage.src == "") {
                this.wheelImage.src = this.canvas.toDataURL();
            }
        }
    },

    drawRouletteWheelImage(spinAngle) {
        this.canvas = document.getElementById("wheelcanvas");
        if (this.canvas.getContext) {
            this.ctx = this.canvas.getContext("2d");
            //ctx.save();
            this.ctx.clearRect(0, 0, this.canvas.width, this.canvas.height);
            this.ctx.drawImage(this.wheelImage, -this.canvas.width / 2, -this.canvas.width / 2);
            this.ctx.rotate(spinAngle * Math.PI / 180);
        }

    },

    rotateWheelImage() {
        this.spinTime += 30;
        if (this.spinTime >= this.spinTimeTotal) {
            stopRotateWheelImage();
            return;
        }
        this.spinAngle = this.spinAngleStart - easeOut(this.spinTime, 0, this.spinAngleStart, this.spinTimeTotal);
        this.spinAngleRad = this.spinAngle * Math.PI / 180;
        this.startAngle += this.spinAngleRad;


        // determine whether to play the sound 
        playSoundIfNeededWithWeights(); //playSoundIfNeeded(spinAngleRad);

        // spin the wheel image
        drawRouletteWheelImage(this.spinAngle);
        clearTimeout(this.spinTimeout);
        this.spinTimeout = setTimeout('rotateWheelImage()', 30);
    },

    playSoundIfNeeded(spinAngleRad) {
        if (this.isOddNumberOfChoices && this.isFirstSpinCycle && (this.angleSinceBeep > this.wedgeAngle / 2 && this.timeSinceBeep > 30)) {
            this.timeSinceBeep = 0;
            this.angleSinceBeep = this.startAngle % (this.wedgeAngle / 2);
            this.isFirstSpinCycle = false;
            playSound();
        } else if (this.angleSinceBeep > this.wedgeAngle && this.timeSinceBeep > 30) {
            this.timeSinceBeep = 0;
            this.angleSinceBeep = this.startAngle % this.wedgeAngle;
            if (this.isOddNumberOfChoices) {
                this.angleSinceBeep -= this.wedgeAngle / 2;
            }
            playSound();
        } else {
            this.angleSinceBeep += this.spinAngleRad;
            this.timeSinceBeep += 30;
        }
    },

    playSoundIfNeededWithWeights() {
        // use "startAngle" to check if the current angle is passed the next angle that
        // should beep. may need to add another variable tracking what the last angle it 
        // beeped for
        if (this.timeSinceBeep > 30) {
            this.currChoiceIndex = getCurrentChoiceWithWeights().index;
            if (this.currChoiceIndex != this.lastChoiceBeepedFor) {
                this.lastChoiceBeepedFor = this.currChoiceIndex;
                this.timeSinceBeep = 0;
                playSound();
            } else {
                this.timeSinceBeep += 30;
            }
        } else {
            this.timeSinceBeep += 30;
        }
    },

    easeOut(t, b, c, d) {
        this.ts = (t /= d) * t;
        this.tc = this.ts * t;
        return b + c * (this.tc + -3 * ts + 3 * t);
    },

    getCurrentChoice() {
        this.degrees = this.startAngle * 180 / Math.PI + 180; // left side, not top
        this.arcd = this.arc * 180 / Math.PI;
        this.index = Math.floor((360 - this.degrees % 360) / this.arcd);
        this.text = this.questions[index];
        this.choice = { text: this.text, index: this.index };
        return this.choice;
    },

    getCurrentChoiceWithWeights() {
        this.degrees = this.startAngle * 180 / Math.PI + 180; // left side, not top
        this.arcd = this.arc * 180 / Math.PI;
        this.degreesMod = 360 - this.degrees % 360;
        this.weightedIndex = 0;
        for (this.index = 0; this.index < this.questions.length; this.index++) {
            this.weight = 1;
            if (this.weights.length > this.index) {
                this.weight = this.weights[this.index];
            }
            this.weightedIndex += this.weight;
            if (this.degreesMod < this.weightedIndex * this.arcd) {
                this.text = this.questions[this.index];
                this.choice = { text: this.text, index: this.index };
                return this.choice;
            }
        }
        this.index = Math.floor((360 - this.degrees % 360) / this.arcd);
        this.text = this.questions[this.index];
        this.choice = { text: this.text, index: this.index };
        return this.choice;
    },

    setWeightedVariables() {
        this.numOptionsWeighted = this.questions.length;
        if (this.weights.length > 0) {
            for (var i = 0; i < this.weights.length; i++) {
                this.numOptionsWeighted += this.weights[i] - 1;
            }
        }
        this.arc = Math.PI / (this.numOptionsWeighted / 2);
        this.wedgeAngle = Math.PI * 2 / this.numOptionsWeighted;
    },

    //setWeightedVariables()

    setNumberOption() {
        if (this.numOptionsWeighted % 2 == 1) {
            this.isOddNumberOfChoices = true;
            this.isFirstSpinCycle = true;
        }
        return this.isOddNumberOfChoices, this.isFirstSpinCycle; 
    },

    //setNumberOption();

    setMobile() {
        if (/Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent)) {
            this.isMobile = true;
        }
        return this.isMobile;
    },

    //setMobile();

    setDimensionWindow() {
        if (window.frameElement) {
            this.maxWidth = window.frameElement.offsetWidth;
            this.maxHeight = window.frameElement.offsetHeight;
        }
        this.minDimension = Math.min(this.maxWidth, this.maxHeight);
        return this.minDimension;
    },

    //setDimensionWindow();

    setCanvasWidth() {
        if (!this.isMobile) {
            this.canvasWidth = 500; 
            this.canvas.width = this.canvasWidth;
            this.canvas.height = this.canvasWidth;
            this.wheelSize = this.canvasWidth;
            this.canvasTop.width = this.canvasWidth;
            this.canvasTop.height = this.canvasWidth;
            this.canvOuter = document.getElementById('wheelcanvasOuter');
            this.canvOuter.style.width = this.canvasWidth + "px";
            this.canvOuter.style.height = this.canvasWidth + "px";

            /*var context = canvTop.getContext('2d');
            var imageObj = new Image();
        
            imageObj.onload = function () {
                context.drawImage(imageObj, 0, 0, canvasWidth, canvasWidth);
            };
            imageObj.src = 'images/init_spin.png';*/
        }
    },

    wheelMouseDown(e) {
        clearTopCanvas();
        drawArrow();
        this.wheeldiv = document.getElementById("capaSuperior");
        this.midX = this.wheeldiv.offsetLeft + this.wheelRadius + this.wheeldiv.offsetParent.offsetLeft + this.wheeldiv.offsetParent.offsetParent.offsetLeft;
        this.midY = this.wheeldiv.offsetTop + this.wheelRadius + this.wheeldiv.offsetParent.offsetTop + this.wheeldiv.offsetParent.offsetParent.offsetTop;
        this.lastX = e.clientX;
        this.lastY = e.clientY;
        this.isMouseDown = true;
    },

    drawRouletteWheel() {
        this.canvas = document.getElementById("wheelcanvas");
        if (this.canvas.getContext) {

            this.ctx = this.canvas.getContext("2d");
            this.ctx.setTransform(1, 0, 0, 1, 0, 0);
            this.ctx.clearRect(0, 0, this.canvas.width, this.canvas.height);
            this.ctx.strokeStyle = "black";
            this.ctx.lineWidth = 0;
            this.ctx.translate(this.canvas.width / 2, this.canvas.height / 2);
            this.ctx.font = 'bold 12px sans-serif';
            this.weightedIndex = 0;

            for (var i = 0; i < this.numoptions; i++) {
                this.weightedArc = this.arc;
                this.weight = 1;
                if (this.weights.length > i) {
                    this.weight = this.weights[i];
                    this.weightedArc = this.arc * this.weight;
                }

                this.angle = this.startAngle + this.weightedIndex * this.arc;
                this.ctx.fillStyle = this.colors[i % this.numcolors];
                this.ctx.beginPath();
                this.endAngle = this.angle + this.weightedArc;
                // Chrome 43.0.2357.81 m arc issue
                if (this.endAngle > 6.282 && this.endAngle < 6.284) {
                    this.endAngle = 6.282;
                }
                this.ctx.arc(0, 0, this.outsideRadius, this.angle, this.endAngle, false);
                this.ctx.arc(0, 0, this.insideRadius, this.endAngle, this.angle, true);
                this.ctx.fill();
                this.ctx.save();

                if (i % 2 == 0) { this.ctx.fillStyle = "#ffffff"; } else if (i % 2 == 1) { this.ctx.fillStyle = "#ffffff"; } this.angHalfArc = this.angle + this.weightedArc * 0.5 - 0.04;
                this.ctx.translate(Math.cos(this.angHalfArc) * this.textRadius, Math.sin(this.angHalfArc) * this.textRadius);
                this.ctx.rotate(this.angHalfArc + Math.PI);
                this.text = this.questions[i];

                this.ctx.font = 'bold ' + this.choiceTextSize[i] + 'px sans-serif';

                this.textHWidth = this.ctx.measureText(this.text).width;
                if (this.textHWidth > this.textRadius - 30) {
                    this.text = this.text.substring(0, 27) + "...";
                }

                this.ctx.fillText(this.text, 0, 0); this.weightedIndex += this.weight;
                this.ctx.restore();
            }

            drawArrow();
        }
    },

    spin() {
        clearTopCanvas();
        drawArrow();
        this.minTimeToSpin = 5;
        this.timeRange = 4;
        this.minAngleToStartRotating = 20;
        this.angleRange = 30;
        this.spinTime = 0;
        this.spinTimeTotal = this.minTimeToSpin * 1000;
        this.angleSinceBeep = 0;
        this.timeSinceBeep = 0;

        this.slowDown = false;
        this.spinAngleStart = Math.random() * this.angleRange + this.minAngleToStartRotating;
        setWheelImageSource();
        rotateWheelImage();
    },

    setChoiceFontSizes() {
        // get the font size of each choice
        this.canvas = document.getElementById("wheelcanvas");
        if (this.canvas.getContext) {
            this.ctx = this.canvas.getContext("2d");
            this.choiceTextSize = [];
            for (var i = 0; i < this.numoptions; i++) {
                this.text = this.questions[i];
                this.ctx.font = 'bold 18px sans-serif';
                this.textHWidth = this.ctx.measureText(this.text).width;
                if (this.textHWidth > this.textRadius - 30) {
                    this.ctx.font = 'bold 15px sans-serif';
                    this.textHWidth = this.ctx.measureText(this.text).width;
                    if (this.textHWidth > this.textRadius - 30) {
                        this.choiceTextSize.push("12");
                    } else {
                        this.choiceTextSize.push("15");
                    }
                } else {
                    this.choiceTextSize.push("18");
                }
            }
        }
    },

    stopRotateWheelImage() {
        clearTimeout(this.spinTimeout);
        
        this.choice = getCurrentChoiceWithWeights();
        this.text = this.choice.text;
        this.index = this.choice.index;

        this.canvasTop = document.getElementById("capaSuperior");
        if (this.canvasTop.getContext) {

            this.ctxTop = this.canvasTop.getContext("2d");

            this.ctxTop.font = 'bold 20px sans-serif';
            this.textHWidth = this.ctxTop.measureText(this.text).width * 0.5;
            if (this.textHWidth > this.wheelRadius) {
                this.ctxTop.font = 'bold 12px sans-serif';
                this.textHWidth = this.ctxTop.measureText(this.text).width * 0.5;
            }

            this.imageObj = new Image();

            this.text = "Qu parte de una planta es?";

            this.imageObj.onload = function () {
                this.ctxTop.drawImage(this.imageObj, 0, 0, this.canvasWidth, this.canvasWidth);
                this.ctxTop.fillStyle = "black";
                this.ctxTop.fillText(this.text, 20, 20);
            };

            if (this.index == 0) {
                this.imageObj.src = "../../assets/img/ruleta/flor.png";
            } else if (this.index == 1) {
                this.imageObj.src = "../../assets/img/ruleta/hoja.png";
            } else if (this.index == 2) {
                this.imageObj.src = "../../assets/img/ruleta/raiz.png";
            } else if (this.index == 3) {
                this.imageObj.src = "../../assets/img/ruleta/tallo.png";
            }

            //imageObj.src = 'images/fig_2.png';
            if (!this.isMuted) {
                this.audioFinal = document.getElementById("wheelAudioFinal");
                this.audioFinal.play();
            }
        }
    }
  }
  
};
</script>

